import styled from 'styled-components';

export const Home = styled.div`
  margin-top: 50px;
  position: absolute;
`;

export const BigText = styled.p`
  font-size: 38px;
  animation: ${moveUp} 5s;
`;

const rotate = keyframes`
  from {
    top: 200px;
  }

  to {
    top: 50px;
  }
`;
